def transform_dataset(input_list):
    output_list = []
    header = input_list[0]

    for data_row in input_list[1:]:
        for i in range(1, len(header)):
            if data_row[i]:
                output_list.append([data_row[0], header[i], data_row[i]])

    return output_list

